import React, { useEffect, useState } from 'react';
import api from '../../../utils/api';

export default function MaintenanceRequest() {
  const [requests, setRequests] = useState([]);
  const [type, setType] = useState('electrician');
  const [description, setDescription] = useState('');
  const [loading, setLoading] = useState(true);
  const [submitting, setSubmitting] = useState(false);
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchRequests();
  }, []);

  const fetchRequests = () => {
    setLoading(true);
    api.get('/maintenance')
      .then(res => {
        // Filter requests by resident (current user)
        const userId = JSON.parse(localStorage.getItem('livinglinkUser'))?.id;
        const filtered = res.data.filter(r => r.resident === userId);
        setRequests(filtered);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage('');
    if (!description) {
      setMessage('Please enter description');
      return;
    }
    setSubmitting(true);
    try {
      await api.post('/maintenance', { type, description });
      setMessage('Maintenance request submitted');
      setDescription('');
      setType('electrician');
      fetchRequests();
    } catch (err) {
      setMessage(err.response?.data?.message || 'Failed to submit request');
    }
    setSubmitting(false);
  };

  return (
    <div>
      <h3>Maintenance Requests</h3>
      <form onSubmit={handleSubmit} className="mb-4">
        <div className="mb-3">
          <label>Type</label>
          <select className="form-select" value={type} onChange={e => setType(e.target.value)}>
            <option value="electrician">Electrician</option>
            <option value="plumber">Plumber</option>
            <option value="carpenter">Carpenter</option>
            <option value="cleaner">Cleaner</option>
          </select>
        </div>
        <div className="mb-3">
          <label>Description</label>
          <textarea
            className="form-control"
            rows="3"
            value={description}
            onChange={e => setDescription(e.target.value)}
            required
          />
        </div>
        {message && <div className="mb-3 text-success">{message}</div>}
        <button className="btn btn-primary" type="submit" disabled={submitting}>
          {submitting ? 'Submitting...' : 'Submit Request'}
        </button>
      </form>

      <h5>Your Requests</h5>
      {loading ? <p>Loading...</p> : (
        requests.length === 0 ? <p>No maintenance requests found.</p> :
          requests.map(r => (
            <div className="card mb-2" key={r._id}>
              <div className="card-body">
                <p><strong>Type:</strong> {r.type}</p>
                <p>{r.description}</p>
                <small>Status: <strong>{r.status}</strong></small><br />
                <small>Submitted on {new Date(r.createdAt).toLocaleString()}</small>
              </div>
            </div>
          ))
      )}
    </div>
  );
}
